import React from "react";
import { Link } from "react-router-dom";
import { motion } from "framer-motion";
import logo from "../assets/logo.png";
import heroImage from "../assets/hero-doberman.jpg";
import Kid from "../assets/kid.jpg";
import Mother from "../assets/Mother.jpg";
import Father from "../assets/Father.jpg";

const Home = () => {
  return (
    <div className="bg-gray-900 text-white min-h-screen flex flex-col">
      {/* Navbar */}
      <header className="flex justify-between items-center px-6 py-4 bg-gray-800 shadow-lg sticky top-0 z-50">
        <div className="flex items-center">
          <img src={logo} alt="Logo" className="h-12 w-auto mr-4" />
          <h1 className="text-3xl font-bold">Haithem Doberman Breeding</h1>
        </div>
        <nav className="hidden md:flex space-x-6">
          {["About Us", "Available Puppies", "Gallery", "Testimonials", "Blog", "Contact"].map((item) => (
            <Link key={item} to={`/${item.toLowerCase().replace(" ", "-")}`} className="hover:text-gray-400">
              {item}
            </Link>
          ))}
        </nav>
      </header>

      {/* Hero Section */}
      <section className="relative w-full h-[600px] flex items-center justify-center text-center">
        <motion.img
          src={heroImage}
          alt="Doberman Hero"
          className="absolute inset-0 w-full h-full object-cover opacity-50"
          initial={{ scale: 1.2 }}
          animate={{ scale: 1 }}
          transition={{ duration: 1.5 }}
        />
        <div className="relative z-10">
          <motion.h2
            className="text-6xl font-bold mb-4"
            initial={{ opacity: 0, y: -50 }}
            animate={{ opacity: 1, y: 0 }}
            transition={{ duration: 1 }}
          >
            Welcome to Our Doberman Family
          </motion.h2>
          <p className="text-lg mb-6 max-w-2xl mx-auto">
            We breed healthy, happy Dobermans with excellent temperaments.
          </p>
          <Link
            to="/available-puppies"
            className="bg-blue-600 text-white py-3 px-6 rounded-lg text-lg hover:bg-blue-500 transition"
          >
            View Available Puppies
          </Link>
        </div>
      </section>

      {/* Image Grid Section */}
      <section className="container mx-auto py-16 px-6">
        <h3 className="text-4xl font-bold text-center mb-8">Our Dobermans</h3>
        <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-8">
          {[{ img: Father, title: "Champion Bloodline" }, { img: Mother, title: "Strong & Intelligent" }, { img: Kid, title: "Loyal & Protective" }].map((dog, index) => (
            <motion.div
              key={index}
              className="bg-gray-800 p-4 rounded-lg shadow-lg flex flex-col items-center overflow-hidden"
              initial={{ opacity: 0, y: 50 }}
              whileInView={{ opacity: 1, y: 0 }}
              transition={{ duration: 0.8, delay: index * 0.3 }}
            >
              <img src={dog.img} alt={dog.title} className="w-full h-96 object-cover rounded-lg" />
              <h4 className="text-xl font-semibold mt-4">{dog.title}</h4>
              <p className="text-gray-300 mt-2 text-center">
                Lorem ipsum dolor sit amet, consectetur adipisicing elit.
              </p>
            </motion.div>
          ))}
        </div>
      </section>

      {/* Call to Action */}
      <motion.section className="bg-blue-700 py-12 text-center" initial={{ opacity: 0 }} animate={{ opacity: 1 }} transition={{ duration: 1 }}>
        <h3 className="text-4xl font-bold">Join Our Community</h3>
        <p className="text-lg mt-4">Sign up to receive updates on new puppies and breeding insights!</p>
        <Link to="/signup" className="mt-6 inline-block bg-white text-blue-700 py-3 px-6 rounded-lg text-lg hover:bg-gray-200 transition">
          Sign Up Now
        </Link>
      </motion.section>

      {/* Footer */}
      <footer className="bg-gray-800 p-6 text-center mt-12">
        <p>&copy; {new Date().getFullYear()} Haithem Doberman Breeding. All rights reserved.</p>
      </footer>
    </div>
  );
};

export default Home;
